import TypingCustom from './TypingCustom'
import Link from 'next/link';
import Fade from 'react-reveal/Fade';
import Typing from 'react-typing-animation';


const Header = () => (
    <div className='outestdiv'>
        <div className='outerdiv'>
            <div className='titlelogo'>
                <Link href='/'>
                    <a>slern.io</a>
                </Link>
            </div>
            <div className='signin'>
                <Link href='/login'>
                    <a>Sign In</a>
                </Link>
            </div>
        </div>
        <div className='tagline'>
            <p>

                <span className='keyword'>for</span> <Typing> <Typing.Delay ms={500} /> <span className='variable'>cs_students</span> <span className='keyword'>by</span> <span className='variable'>cs_students</span> </Typing>

            </p>
        </div>
        <style jsx>{`
        .outestdiv {
            border-style: solid;
            border-width: 1px;
        }
        .tagline {
            text-align: center;
            padding-bottom: 50px;
            color: #486491;
            font-size: 40px;

            font-family: Courier; 
        }
        .keyword {
            font-weight: 700;
            color: blue;
        }

        .outerdiv {
            width: 100%;
            height: 50px;
            display: grid;
            font-family: Arial; 
            grid-template-columns: 95% 5%;
            font-size: 20px;

        }
        .titlelogo {
            color: #9B85F6;
            font-weight: bold;
            text-decoration: none;
            font-family: 'Arial';
            margin-left: 5px;
            margin-top: 5px;
        }
        .signin {
            color: #2181D5;
            font-weight: bold;
            font-family: 'Arial';
            margin-top: 5px;
            font-size: 20px;
            color: #9B85F6;
        }
        .signin:hover {
            opacity: 0.6;

        }
        a {
            text-decoration: none;
            font-family: 'Arial';
          }


        `}</style>
    </div>
);

export default Header;
